import React from 'react';
import logo from './logo.png';

class Header extends React.Component{
    render(){
        return(
            <div style={{backgroundImage: {logo}, margin: '100px'}}>
                Selamat Datang di Sanbercode Todo
            </div>
        );
    }
}

export default Header;
